clear; clc; close all;

files  = ["orbit_v1.dat","orbit_v12.dat"];
labels = ["V1","1.2·V1"];

S = cell(1,2);
for k = 1:2
    S{k} = readmatrix(files(k), "FileType","text", "CommentStyle","#");
end

% 1) Trajektoor y(x)
figure; hold on; grid on; axis equal; %[output:9da6c31f]
for k = 1:2
    plot(S{k}(:,2)/1000, S{k}(:,3)/1000, 'LineWidth', 1.5); %[output:9da6c31f]
end
xlabel('x (km)'); ylabel('y (km)'); %[output:9da6c31f]
title('Trajektoor Veenuse ümber: V1 vs 1.2·V1'); %[output:9da6c31f]

% Veenuse ring (planet)
Rv = 6051800;                 % Veenuse raadius meetrites (sama mis Fortranis)
theta = linspace(0, 2*pi, 600);
xp = (Rv/1000) * cos(theta);  % km
yp = (Rv/1000) * sin(theta);  % km
plot(xp, yp, 'k-', 'LineWidth', 2);  % planeedi kontuur %[output:9da6c31f]

legend(labels, 'Location','best'); %[output:9da6c31f]

% 2) Energiad (Ekin, Epot, Etot) - eraldi aknad, et loetav oleks
for k = 1:2 %[output:group:681d3bd5]
    t    = S{k}(:,1);
    Ekin = S{k}(:,8);
    Epot = S{k}(:,9);
    Etot = S{k}(:,10);

    figure; hold on; grid on; %[output:7d5967aa] %[output:2f38026e]
    plot(t, Ekin, 'LineWidth', 1.2);
    plot(t, Epot, 'LineWidth', 1.2);
    plot(t, Etot, 'LineWidth', 1.2);
    xlabel('t (s)'); ylabel('Energia (J/kg)');
    title("Energiad ajas: " + labels(k));
    legend('E_{kin}','E_{pot}','E_{tot}', 'Location','best');
end %[output:group:681d3bd5]

% 3) Koguenergia drift (hea kontroll) - mõlemad ühel graafikul
figure; hold on; grid on; %[output:585cc59e]
for k = 1:2
    t    = S{k}(:,1);
    Etot = S{k}(:,10);
    plot(t, Etot - Etot(1), 'LineWidth', 1.5); %[output:585cc59e]
end
xlabel('t (s)'); ylabel('\Delta E_{tot} (J/kg)'); %[output:585cc59e]
title('Koguenergia muutus: V1 vs 1.2·V1'); %[output:585cc59e]
legend(labels, 'Location','best'); %[output:585cc59e]


